import React, { Component } from 'react';
import Menu from './Menu';
import '../../public/css/Header.css';

class Header extends Component{

    render() {
        return (
            <div>
                <Menu name = "Home"/>
                <Menu name = "About"/>
                <Menu name = "Skills"/>
                <Menu name = "Projects"/>
                <Menu name = "Contact"/>
            </div>
        )
    }
}

export default Header;
